import React from 'react';

const RecipeInfo =({ recipe }) => {
    return (
        <ul className="ingredient-list">
            <li className="ingredient-text">{recipe.healthLabels}</li>
            <li className="ingredient-weight">Weight - {recipe.dietLabels}</li>
        </ul>
    )

}

export default RecipeInfo;
